import React, { useState } from 'react';
import { FaSearch, FaMapMarkerAlt, FaLocationArrow } from 'react-icons/fa';

const SearchBar3 = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [location, setLocation] = useState('');
  const [category, setCategory] = useState('');
  const [isLocationLoading, setIsLocationLoading] = useState(false);

  const handleSearch = (e) => {
    e.preventDefault();
    console.log('Searching for:', { searchQuery, location, category });
    // Add your search logic here
  };

  const handleNearMe = async (e) => {
    e.preventDefault();
    setIsLocationLoading(true);
    try {
      const position = await new Promise((resolve, reject) => {
        navigator.geolocation.getCurrentPosition(resolve, reject);
      });
      
      // In a real app, you would reverse geocode these coordinates to get a location name
      console.log('User location:', position.coords);
      alert('Ubicación obtenida con éxito!');
      // You would typically update the location state with the actual location name here
    } catch (error) {
      console.error('Error getting location:', error);
      alert('No se pudo obtener la ubicación. Por favor, asegúrate de haber otorgado los permisos necesarios.');
    } finally {
      setIsLocationLoading(false);
    }
  };

  return (
    <div className="w-full max-w-6xl mx-auto px-4 sm:px-6 lg:px-8 py-6">
      <form 
        onSubmit={handleSearch}
        className="bg-white dark:bg-gray-800 rounded-2xl shadow-lg overflow-hidden transition-all duration-300 hover:shadow-xl"
      >
        <div className="flex flex-col md:flex-row items-stretch divide-y md:divide-y-0 md:divide-x divide-gray-200 dark:divide-gray-700">
          {/* City Select */}
          <div className="relative flex-1">
            <select
              value={location}
              onChange={(e) => setLocation(e.target.value)}
              className="w-full h-full px-6 py-4 text-gray-700 dark:text-gray-200 bg-transparent border-0 focus:ring-2 focus:ring-pink-500 focus:ring-opacity-50 rounded-lg appearance-none"
            >
              <option value="">Selecciona Ciudad</option>
              <option value="monterrey">Monterrey</option>
              <option value="cdmx">Ciudad de México</option>
              <option value="guadalajara">Guadalajara</option>
              <option value="cancun">Cancún</option>
              <option value="tulum">Tulum</option>
            </select>
            <div className="absolute inset-y-0 right-0 flex items-center pr-4 pointer-events-none">
              <svg className="w-5 h-5 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
              </svg>
            </div>
          </div>

          {/* Category Select */}
          <div className="relative flex-1">
            <select
              value={category}
              onChange={(e) => setCategory(e.target.value)}
              className="w-full h-full px-6 py-4 text-gray-700 dark:text-gray-200 bg-transparent border-0 focus:ring-2 focus:ring-pink-500 focus:ring-opacity-50 rounded-lg appearance-none"
            >
              <option value="">Categoría</option>
              <option value="restaurantes">Restaurantes</option>
              <option value="hoteles">Hoteles</option>
              <option value="atracciones">Atracciones</option>
              <option value="eventos">Eventos</option>
              <option value="compras">Compras</option>
            </select>
            <div className="absolute inset-y-0 right-0 flex items-center pr-4 pointer-events-none">
              <svg className="w-5 h-5 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
              </svg>
            </div>
          </div>

          {/* Search Input */}
          <div className="flex-1 relative">
            <input
              type="text"
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
              placeholder="¿Qué buscas?"
              className="w-full h-full px-6 py-4 text-gray-700 dark:text-gray-200 bg-transparent border-0 focus:ring-2 focus:ring-pink-500 focus:ring-opacity-50 rounded-lg focus:outline-none"
            />
            <div className="absolute inset-y-0 right-0 flex items-center pr-4">
              <FaSearch className="text-gray-400" />
            </div>
          </div>

          {/* Location Button */}
          <button
            onClick={handleNearMe}
            disabled={isLocationLoading}
            className="flex items-center justify-center px-6 py-4 text-pink-600 dark:text-pink-400 hover:bg-gray-50 dark:hover:bg-gray-700 transition-colors duration-200 whitespace-nowrap"
          >
            <FaLocationArrow className="mr-2" />
            {isLocationLoading ? 'Buscando...' : 'Cerca de mí'}
          </button>

          {/* Search Button */}
          <button
            type="submit"
            className="bg-pink-500 hover:bg-pink-600 text-white px-8 py-4 font-medium transition-colors duration-200 flex items-center justify-center"
          >
            <FaSearch className="mr-2" />
            Buscar
          </button>
        </div>
      </form>
    </div>
  );
};

export default SearchBar3;
